import {formatDate} from '@/utils/formatTime'

module.exports = {
    log: function(a){
        console.log(`[SOCKET | ${formatTime(new Date()) } ]: ` + a)
    },
    warn: function (a) {
        console.log(`[SOCKET | ${formatTime(new Date())} ]: ` + a)
    },
    error: function (a) {
        console.error(`[SOCKET | ${formatTime(new Date())} ]: ` + a)
    },
}
